}

void initFromSalesQuotationLine(SalesQuotationLine  _salesQuotationLine)
{
    // <GIN>
    TransTaxInformation                 transTaxInformation;
    SalesQuotationLineTaxExtensionIN    salesQuotationLineTaxExtensionIN;
    // </GIN>

    this.OrigQuotationId        = _salesQuotationLine.QuotationId;
    this.InventTransId          = _salesQuotationLine.InventTransId;
    this.LineNum                = _salesQuotationLine.LineNum;
    this.InventDimId            = _salesQuotationLine.InventDimId;
    this.ItemId                 = _salesQuotationLine.ItemId;
    this.SalesCategory          = _salesQuotationLine.SalesCategory;
    this.StockedProduct         = _salesQuotationLine.StockedProduct;
    this.LineNum                = _salesQuotationLine.LineNum;
    this.ExternalItemId         = _salesQuotationLine.ExternalItemId;
    this.Name                   = _salesQuotationLine.Name;
    this.TaxItemGroup           = _salesQuotationLine.TaxItemGroup;
    this.TaxGroup               = _salesQuotationLine.TaxGroup;
    this.OverrideSalesTax       = _salesQuotationLine.OverrideSalesTax;
    this.CurrencyCode           = _salesQuotationLine.CurrencyCode;
    this.SalesUnit              = _salesQuotationLine.SalesUnit;
    this.PriceUnit              = _salesQuotationLine.PriceUnit;
    this.Qty                    = _salesQuotationLine.SalesDeliverNow;

    this.PdsCWQty               = _salesQuotationLine.PdsCWDeliverNow;

    this.SalesPrice             = _salesQuotationLine.SalesPrice;
    this.SalesMarkup            = _salesQuotationLine.SalesMarkup;
    this.DiscPercent            = _salesQuotationLine.discPercent();
    this.DiscAmount             = _salesQuotationLine.discAmount();
    this.LineDisc               = _salesQuotationLine.LineDisc;
    this.LinePercent            = _salesQuotationLine.LinePercent;
    this.MultiLnDisc            = _salesQuotationLine.MultiLnDisc;
    this.MultiLnPercent         = _salesQuotationLine.MultiLnPercent;
    this.SalesGroup             = _salesQuotationLine.SalesGroup;
    this.DefaultDimension       = this.copyDimension(_salesQuotationLine.DefaultDimension);
    this.LineHeader             = _salesQuotationLine.LineHeader;
    this.DlvDate                = _salesQuotationLine.dlvDate();
    this.DlvTerm                = _salesQuotationLine.DlvTerm;

    this.ProjCategoryId         = _salesQuotationLine.ProjCategoryId;
    this.LinePropertyId         = _salesQuotationLine.LinePropertyId;
    this.ProjDescription        = _salesQuotationLine.ProjDescription;
    this.ProjTransType          = _salesQuotationLine.ProjTransType;
    this.ProjectResource        = _salesQuotationLine.ProjectResource;
    this.ActivityId             = _salesQuotationLine.ProjActivity;

    this.Company                = _salesQuotationLine.Company;
    this.AccountType            = _salesQuotationLine.AccountType;
    this.OffsetCompany          = _salesQuotationLine.OffsetCompany;
    this.OffsetAccountType      = _salesQuotationLine.OffsetAccountType;
    this.LedgerDimension        = _salesQuotationLine.OffsetLedgerDimension;

    this.TransDate              = _salesQuotationLine.TransDate;
    this.StartDate              = _salesQuotationLine.StartDate;
    this.EndDate                = _salesQuotationLine.EndDate;

    // <GIN>
    if (TaxParameters::checkTaxParameters_IN())
    {
        transTaxInformation              = TransTaxInformationHelper::findOrCreateTransTaxInformationByRecord(_salesQuotationLine);
        salesQuotationLineTaxExtensionIN = SalesQuotationLineTaxExtensionIN::findBysalesQuotationLine(_salesQuotationLine.RecId, true);

        this.RegistrationLocation_IN   = transTaxInformation.CompanyLocation;
        this.ServiceCodeTable_IN       = transTaxInformation.ServiceCode;
        this.ExciseTariffCodes_IN      = transTaxInformation.ExciseTariffCodes;
        this.CustomsTariffCodeTable_IN = transTaxInformation.CustomsTariffCode;
        this.ExciseRecordType_IN       = transTaxInformation.ExciseRecordType;
        this.AssessableValue_IN        = salesQuotationLineTaxExtensionIN.AssessableValueTransactionCurrency;
        this.MaximumRetailPrice_IN     = salesQuotationLineTaxExtensionIN.MaximumRetailPrice;
        this.CompanyLocation_IN        = transTaxInformation.CompanyLocation;
        this.TaxInformation_IN         = transTaxInformation.TaxInformation;
        this.SalesTaxFormTypes_IN      = transTaxInformation.SalesTaxFormTypes;
        this.ExciseType_IN             = transTaxInformation.ExciseType;
    }
    // </GIN>
}

InventDim inventDim(boolean  update = false)
{
    return InventDim::find(this.InventDimId, update);
}

/// <summary>
///    Indicates whether the journal line is category based.
/// </summary>
/// <returns>
///    true if the journal line is category-based; otherwise, false.
/// </returns>
boolean isCategoryBased()
{
    return !this.ItemId && this.SalesCategory;
}

display LineAmount lineAmountInclTax()
{
    return this.LineAmount + this.LineAmountTax;
}

/// <summary>
/// Retrieves a dimension set that holds the merged combination of the current <c>defaultDimension</c>
/// field on this table and the provided dimension set.
/// </summary>
/// <param name="_primaryDefaultDimension">
/// A first dimension set to merge with the current <c>defaultDimension</c> field on this table.
/// </param>
/// <param name="_secondaryDefaultDimension">
/// A second dimension set to merge with the current <c>defaultDimension</c> field on this table;
/// optional.
/// </param>
/// <param name="_dimensionMerge">
/// A <c>dimensionMerge</c> object that was previously created using the current buffer; optional.
/// </param>
/// <returns>
/// A dimension set that holds the merged combination of the current <c>defaultDimension</c> field on
/// this table and the provided dimension set.
/// </returns>
/// <remarks>
/// This method makes sure that potential linked dimensions are not overwritten when merging.
/// Additionally the entity specifier defaulting will be considered.
/// </remarks>
public DimensionDefault mergeDimension(DimensionDefault _primaryDefaultDimension,
                                        DimensionDefault _secondaryDefaultDimension = 0,
                                        DimensionMerge   _dimensionMerge = DimensionMerge::newFromTable(this, this.companyInfo().RecId))
{
    return _dimensionMerge.merge(_primaryDefaultDimension, _secondaryDefaultDimension);
}

