[SysClientCacheDataMethodAttribute(true)]
display client server QuotationId quotationDocNum()
{
    CustQuotationJour   custQuotationJour = this.custQuotationJour();

    if (custQuotationJour)
    return custQuotationJour.QuotationDocNum;

    return this.QuotationId;
}

display UnitOfMeasureReportingText salesUnitTxt()
{
    CustQuotationJour   custQuotationJour = this.custQuotationJour();

    if (custQuotationJour)
    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
        custQuotationJour.LanguageId);

    if (this.SalesId)
    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
        SalesTable::find(this.SalesId).LanguageId);

    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
    UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
    CompanyInfo::languageId());
}

static CustQuotationTrans findRecId(RecId       recId,
                                boolean     update = false )
{
    CustQuotationTrans custQuotationTrans;

    custQuotationTrans.selectForUpdate(update);

    select custQuotationTrans
    where custQuotationTrans.RecId== recId;

    return custQuotationTrans;
}

[SubscribesTo(classStr(DimensionObjectStorageTableReferenceProcessor), delegatestr(DimensionObjectStorageTableReferenceProcessor, impliedDataAreaFieldNameDelegate))]
static void impliedDataAreaFieldNameDelegate(TableId _tableId, FieldId _fieldId, EventHandlerResult _result)
{
    if (_tableId == tableNum(CustQuotationTrans))
    {
        switch(_fieldId)
        {
            case(fieldNum(CustQuotationTrans, LedgerDimension)):
            case(fieldNum(CustQuotationTrans, DefaultDimension)):
                _result.result(fieldStr(CustQuotationTrans, Company));
                break;
        }
    }
}
